import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    console.log('Hello from komponentti')
    return (
        <div>
            <p>Hello world</p>
        </div>
    )
    }

ReactDOM.render(<App />, document.getElementById('root'))
